import React from 'react'
import 'bootstrap/dist/css/bootstrap.min.css';
import './App.css'
// import { useState, useEffect } from 'react'

const Body = () =>{
  return(
    <div className='container'>
      <div id='drum-machine'>
        <div id='display'>
          <div className='drum-kit'>
            <button className='drum-pad btn'>Q</button>
            <button className='drum-pad btn'>W</button>
            <button className='drum-pad btn'>E</button>
            <button className='drum-pad btn'>A</button>
            <button className='drum-pad btn'>S</button>
            <button className='drum-pad btn'>D</button>
            <button className='drum-pad btn'>Z</button>
            <button className='drum-pad btn'>X</button>
            <button className='drum-pad btn'>C</button>
          </div>

        </div>
      </div>
    </div>
  )
}

const App = () => {
  return (
    <div>
      <Body />
    </div>
  )
}

export default App
